import { Grid } from '@material-ui/core';
import React from 'react';
import AdminLink from '../management/AdminLinks';

const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
    },
    gridContainer: {
      paddingTop:"20px",
      minHeight:"100vh"
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
      },
    headPart:{
        backgroundColor:"#133b5c",
      color:"#ffff"
    },
    icon:{
        color:"#fff"
    },
    categorytitle:{
        marginTop:"50px",
        color:"#133b5c",
        fontSize:"35px",
        fontWeight:"600",
        textAlign:"center"
    },
    heading: {
      fontSize: theme.typography.pxToRem(20),
      fontWeight: theme.typography.fontWeightRegular,
    },
  }));

function CreateQuiz() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
        <AdminLink/>
        <h3 className={classes.categorytitle}></h3>
          <Grid
                container
                className={classes.gridContainer}
                justify="center"
             >
                    <Grid container>
                    <Grid item xs></Grid>
                    <Grid item xs={11} sm={6} md={6} lg={4} >
                      <Card className="questioncard">
                   <h3 className="questionname"></h3>
                         <div className="optioncard">
                                  <Grid
                                  container
                                  className="nonclickoption"
                                 >
                                <Grid item xs={4} sm={4} md={4} lg={4} >
                                     <img className="optionImg" src=""/> 
                                </Grid>
                                <Grid item xs={8} sm={8} md={8} lg={8} className="optionbg" >

                                 <CardContent className="cardcontent">
                                   <h3 className="optioncontent" id="cardText">
                                   </h3>
                                 </CardContent>

                               </Grid>
                               </Grid>

                        </div>

                      </Card>
                    </Grid>
                    <Grid item xs></Grid>
                  </Grid>
         </Grid>
        </div>
    )
}

export default CreateQuiz
